import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import './css/Footer.css'; // Ensure the path is correct for your project structure
import Login from './Login.js';
import Signup from './Signup.js';
import { Link } from 'react-router-dom';
import Nav from "react-bootstrap/Nav";
import { useState, useEffect } from "react";
import { BrowserRouter as Router, Switch, Route, Redirect } from "react-router-dom";

function Footer() {

    const [loggedInOwner, setLoggedInOwner] = useState('');

    useEffect(() => {
        const storedOwner = localStorage.getItem('ownerName');
        if (storedOwner) {
            setLoggedInOwner(storedOwner);
        }
    }, []);

    const handleLogin = (ownerName) => {
        setLoggedInOwner(ownerName);
        localStorage.setItem('ownerName', ownerName);
    };

    const handleLogout = () => {
        setLoggedInOwner('');
        localStorage.removeItem('ownerName');
    };

    return (
        <footer className="footer text-white">
            <Container fluid>
                <Row className="justify-content-center">
                    <Col md={12} className="text-center flex-logo">
                        <img
                            src='/logo-removebg-preview.png' // Ensure logo.jpeg is in the public folder
                            alt="DocLock Logo"
                            className="footer-logo mb-4"
                            style={{ width: '100px', height: 'auto' }}
                        />
                        <h1>DocLock</h1>
                    </Col>

                </Row>
                <Row className='flex-content'>
                    <Col md={4} className="text-center">
                        <p>
                            DocLock is a blockchain-based platform providing secure,
                            tamper-proof document storage. We prioritize privacy, transparency,
                            and user control for seamless, trustworthy document management.
                        </p>
                    </Col>
                    <Col md={2} className="text-center">
                        <ul className="footer-links">
                            <Nav className="ml-auto">
                                {loggedInOwner ? (
                                    <>
                                        <Nav.Item>
                                            <Link to="/create-asset" className="nav-link Black">Create Asset</Link>
                                        </Nav.Item>
                                        <Nav.Item>
                                            <Link to="/asset-list" className="nav-link Black">All Assets</Link>
                                        </Nav.Item>
                                        <Nav.Item>
                                            <Link to="/" className="nav-link Black">Home</Link>
                                        </Nav.Item>
                                        <Nav.Item>
                                            <Link to="/" className="nav-link" onClick={handleLogout}>Logout</Link>
                                        </Nav.Item>
                                    </>
                                ) : (
                                    <>
                                        <Nav.Item>
                                            <Link to="/" className="nav-link Black">Home</Link>
                                        </Nav.Item>
                                        <Nav.Item>
                                            <Link to="/login" className="nav-link">Login</Link>
                                        </Nav.Item>
                                        <Nav.Item>
                                            <Link to="/signup" className="nav-link">Signup</Link>
                                        </Nav.Item>
                                    </>
                                )}
                            </Nav>

                        </ul>
                    </Col>
                    <Col md={2} className="text-center">
                        <ul className="footer-contact">
                            <li>Email: support@doclock.com</li>
                            <li>Phone: +91 7058458428</li>
                            <li>Mumbai</li>
                        </ul>
                    </Col>
                </Row>
                <Row className="mt-4">
                    <Col md={12} className="text-center">
                        <p>&copy; 2024 DocLock. All rights reserved.</p>
                    </Col>
                </Row>
            </Container>
        </footer>
    );
}

export default Footer;
